import React, { Component } from "react";

class FavoriteBooks extends Component {
  render() {
    return (
      <div>
        <h2>Favorite Books</h2>
        <p>I do not read all too much but when I do hear are my five favorite books to read.</p>

        <ol>
          <li>My first favorite book is The Hunger Games.</li>
          <li>My second favorite book is The Cat in The Hat.</li>
          <li>My third favorite book is The Great Gatsby.</li>
          <li>My fourth favorite book is Moby Dick.</li>
          <li>My fifth favorite book is 48 Laws of Power.</li>
        </ol>
      </div>
    );
  }
}

export default FavoriteBooks;
